import propTypes from "prop-types";

const foodILike = [
    {
        id: 1,
        name: 'Kimchi',
        image: 'https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Fcdn.1store.io%2FofficialProductImage%2F1587198787425-0712162682417814.png&f=1&nofb=1',
        rating: 4.9
    },
    {
        id: 2,
        name: 'Samgyeopsal',
        image: 'https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Fmp-seoul-image-production-s3.mangoplate.com%2Fmango_pick%2Fuker6u9xhkr1m8.jpg&f=1&nofb=1',
        rating: 4.8
    },
    {
        id: 3,
        name: 'Bibimbap',
        image: 'https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Fcdn.bonif.co.kr%2Fcmdt%2Fdetail%2FBF102_dt_main_10000230.jpg&f=1&nofb=1',
        rating: 4.5
    },
    {
        id: 4,
        name: 'Doncasu',
        image: 'https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Fimg1.daumcdn.net%2Fthumb%2FR800x0%2F%3Fscode%3Dmtistory2%26fname%3Dhttps%253A%252F%252Fk.kakaocdn.net%252Fdn%252FphRQp%252FbtqxXI1O6Cu%252FH1VBM7MYGfmMKlqll64ulk%252Fimg.jpg&f=1&nofb=1',
        rating: 4.8
    }, {
        id: 5,
        name: 'Kimbap',
        image: 'https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Frecipe1.ezmember.co.kr%2Fcache%2Frecipe%2F2015%2F04%2F04%2F0461907459756bc3a56472da407a1a9d1.jpg&f=1&nofb=1',

    },
];

function App() { // return <div className="App" />;
    return (
        <div> {
            foodILike.map(dish => (
                <Food key={
                        dish.id
                    }
                    name={
                        dish.name
                    }
                    picture={
                        dish.image
                    }
                    rating={
                        dish.rating
                    }/>
            ))
        } </div>
    );
}

Food.propTypes={
name: propTypes.string.isRequired,
picture: propTypes.string.isRequired,
rating: propTypes.number.isRequired
}

function Food({name, picture, rating}) {
    return (
        <div>
            <h2>I Like {name}</h2>
            <h4>{rating}/5.0</h4>
            <img src={picture} alt={name}/>
        </div>
    );
}

export default App;
